import ListItem from "./ListItem/ListItem";
import Card from "../Card/Card";
import './List.css'

function List(props){

    const saveClickTrue = (checkboxData) => {
        const checkData = {
          ...checkboxData,
          id:Math.random().toString()
        };
        console.log("List: "+ JSON.stringify(checkData))
        props.onCheckTrue(checkData);
      }

      const listItems = props.array.map((entry, index) => (
        <ListItem
          key={index}
          rarity={entry.raraty} // Assuming the key is 'raraty' and not 'rarity' in your data structure
          hex={entry.hex}
          onCheckTrue={saveClickTrue}
        />
      ));

    return(
    <Card className="expenses">
        {listItems}
    </Card>
    );
}

export default List;
